import React from 'react';
import styled from 'styled-components';

function Footer() {
	return (
		<FooterContainer>
			<div className="nav-footerlink"></div>
		</FooterContainer>
	);
}

const FooterContainer = styled.footer`
	width: 90%;
	max-width: 1060px;
	margin: 0 auto 18px;
	display: flex;
	.nav-footerlink {
		flex-grow: 1;
		display: flex;
		align-items: center;
	}
`;

export default Footer;
